import { useState } from 'react';
import './App.css';
import Homepage from './HomePageComponents/homepage';
import { BrowserRouter, Link, Route, Routes} from "react-router-dom";
import Loginpage from './HomePageComponents/loginpage';
import Signup from './HomePageComponents/signup';


function App() {
  const [openModal, setOpenModal] = useState(false);

  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Homepage />} />
          {/* <Route onClick={()=>{setOpenModal(true)}} path="/login" element={<Loginpage />} /> */}
          <Route path="/signup" element={<Signup />} />
        </Routes>
      </BrowserRouter>
      <button className="openModalBtn" onClick={()=>setOpenModal(true)}>Loginpage</button>
      {openModal && <Loginpage/>}
    </div>
  );
}

export default App;
